$(document).ready(function(){$("#contact-form").validate({rules:{"first-name":{required:!0,minlength:2,maxlength:200},"last-name":{required:!0,minlength:2,maxlength:200},email:{required:!0,email:!0,minlength:2,maxlength:200},message:{required:!0,minlength:2,maxlength:200}},messages:{"first-name":{required:"Please enter your first name",minlength:"First name must be at least 2 characters long",maxlength:"First name must not be longer than 200 characters"},"last-name":{required:"Please enter your last name",minlength:"Last name must be at least 2 characters long",maxlength:"Last name must not be longer than 200 characters"},email:{required:"Please enter your email",email:"Email does not appear to be valid",minlength:"Email must be at least 2 characters long",maxlength:"Email must not be longer than 200 characters"},message:{required:"Please enter a message",minlength:"Message must be at least 2 characters long",maxlength:"Message must not be longer than 200 characters"}},submitHandler:function(a){return request=$.ajax({type:$(a).attr("method"),url:$(a).attr("action"),data:$(a).serialize(),dataType:"json",cache:!1}),request.done(function(a){swal(a.error?{title:"Error!",text:a.message,type:"error",confirmButtonText:"Sure, I will try again."}:{title:"Success!",text:a.message,type:"success",confirmButtonText:"Good news!"})}),!1}})});